import './App.css';
import Passwords from './components/passwords';

import { useState } from 'react';

function App() {

  let [login, updateLogin] = useState(false);

  return (
    <div className="App">
      <Passwords onChange={(param) => {
        updateLogin(param);
      }}></Passwords>
    </div>
  );
}

export default App;
